const Project = () => {

    let Navigate = useNavigate()



    const propsData = (JSON.parse(localStorage.getItem('headers')));

    const getProjectData = async() =>{
        let data = {
            headers: {
                uid: propsData.uid,
                client: propsData.client,
                access_token: propsData.access_token,
            }
        }
        console.warn('PropesData = ',(headers))

        const resp = await axios.get('http://localhost:4000/projects',headers)
        console.warn(resp)
    }


    useEffect(()=>{
        Check()
    },[])

    const Check = () => {
        if (propsData == null){
            Navigate('/Login')
        }
        else {
            getProjectData()
        }
    }

    return (
        <>

        </>
    )
}


export default Project;
